import React from 'react';
import Layout from './Components/Layout';
import Intro from './Components/Intro';
import { contentContainer } from './landing.module.scss';

function Home () {
  return (
    <Layout>
      <div className={contentContainer}>
        <Intro />
      </div>
    </Layout>
  );
};

export default Home;
